import React from 'react';
import Authorization from "./authorization";
import {connect} from "react-redux";
import {updateEmail, updatePassword} from "../../../redux/authReducer";

class AuthorizationContainer extends React.Component{

    render() {
        return <Authorization {...this.props}/>
    }
}
let mapStateToProps=(state)=>{
    return{
        authorization:state.Auth
    }
};
const AuthorizationContainerExport = connect(mapStateToProps,{updateEmail,updatePassword})(AuthorizationContainer);
export default AuthorizationContainerExport
